import { Box } from "@mui/material";

const MainAnnouncement = () => {

    return (
        <Box
            width="95%"
            display="flex"
            backgroundColor="lightblue"
        >
            <h1>¡Bienvenidos a la página de la heladería!</h1>
            <p>¡Prueba nuestros deliciosos helados!</p>
        </Box>
    )
}

export default MainAnnouncement;
